import FeeCalculator from "./FeeCalculator";

class FeeDecorator extends FeeCalculator {
    calculateService(price) {
        return price * 0.1;
    }
    calculateInsurance(price) {
        return price * 0.05;
    }
}

export default FeeDecorator;
